(18, 1, 'rekord', ' To zestaw danych, zazwyczaj posiadajcy ustalon wewntrzn struktur, stanowicy pewn cao, ale mogcy by czci wikszego zbioru podobnych rekordw. ', NULL, 1, NULL),
(19, 1, 'row', ' A rowalso called a tuplerepresents a single, implicitly structured data item in a table. In simple terms, a database table can be thought of as consisting of rows and columns. Each row in a table represents a set of related data, and every row in the table has the same structure.', NULL, 2, '/r/'),
