(21, 1, 'foreign key', 'a foreign key is a set of attributes subject to a certain kind of inclusion dependency constraint, specifically a constraint that the tuples consisting of the foreign key attributes in one relation', NULL, 2, '/fn ki/'),
(22, 2, 'karta sieciowa', 'karta rozszerzenia suca do przeksztacania pakietw danych w sygnay, ktre s przesyane w sieci komputerowej. Karty NIC pracuj w okrelonym standardzie, np. Ethernet, Token Ring, FDDI, ArcNet czy 100VGAnylan, i podobnie jak switche, s elementami aktywnymi sieci.', NULL, 1, NULL),
(23, 2, 'network interface card', 'a computer hardware component that connects a computer to a computer network.\r\n\r\nEarly network interface controllers were commonly implemented on expansion cards that plugged into a computer bus. The low cost and ubiquity of the Ethernet standard means that most newer computers have a network interface built into the motherboard.', NULL, 2, NULL),
(24, 2, 'przecznik', 'Urzdzenie czce segmenty sieci komputerowej pracujce gwnie w drugiej warstwie modelu ISO/OSI (cza danych). Jego zadaniem jest przekazywanie ramki midzy segmentami sieci z doborem portu przecznika, na ktry jest przekazywana.', NULL, 1, NULL),
(25, 2, 'switch', 'Is networking hardware that connects devices on a computer network by using packet switching to receive and forward data to the destination device.\r\n\r\nA network switch is a multiport network bridge that uses MAC addresses to forward data at the data link layer (layer 2) of the OSI model.', NULL, 2, '/swt/'),
(26, 2, 'skrtka', 'rodzaj przewodu sygnaowego sucego do przesyania informacji, ktry zbudowany jest z jednej lub wikszej liczby par kabli skrconych ze sob w celu eliminacji wpywu zakce elektromagnetycznych oraz zakce wzajemnych, zwanych przesuchami. Skrcenie y powoduje jednoczenie zawenie pasma transmisyjnego.', NULL, 1, NULL),
(27, 2, 'twisted pair', 'Is a type of wiring in which two conductors of a single circuit are twisted together for the purposes of improving electromagnetic compatibility. Compared to a single conductor or an untwisted balanced pair, a twisted pair reduces electromagnetic radiation from the pair and crosstalk between neighboring pairs and improves rejection of external electromagnetic interference.', NULL, 2, NULL);

